import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Component, useState } from 'react';
import { Collapse, Container, Row, Col } from 'react-bootstrap';
import CreateUser from './components/createuser'

class App extends Component {
  state = {
    user: {}
  }

  CreateUser = (e) => {
    CreateUser(this.state.user)
    .then(response => {
      console.log(response);
    })
  }

  render() {
    return(
      <div className="App-header">
        <header className="header">
          <h1 className="title">Twatter</h1>
          <Button className="login" variant="primary">Log in</Button>
          <Button className="signup" variant="primary">Sign up</Button>
        </header>
        <CreateUser>
          createUser={this.CreateUser}
        </CreateUser>
        <Container>
          <Row>
              <Col md={9} className="userUI" id="example-collapse-text">hello</Col>
              <Col md={3}>Noob</Col>
          </Row>
        </Container>
      </div>
    );
  }
}


export default App;
